import * as React from 'react';

export const Main: React.FC = () => {
  let result: number = 0;
  const weather = async () => {
    await fetch(
      `https://api.openweathermap.org/data/2.5/weather?zip=94040,us&appid=6cd33f76e223beefab317e542a910250`
    )
      .then(res => res.json())
      .then(data => (result = data.main.temp));
    return result;
  };
  return (
    <div className="">
      It is working
      <button onClick={weather}>Request</button>
      {result}
    </div>
  );
};
